without having departments within it
and may not be part of another 
department, such as the highest 
office (i.e. the president’s office).  ', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
INSERT INTO R_REL VALUES (
    "a68038fd-6a77-4f1c-9d04-2ee2357cb331", -- Rel_ID : UNIQUE_ID
    23, -- Numb : INTEGER
    'Established when an employee
is assigned the role of 
managing a department.
An employee may manage
more than one department,
and occasionally, a department
may not be assigned a manager.', -- Descrip : STRING
    "00000000-0000-0000-0000-000000000000" -- SS_ID : UNIQUE_ID
);
