    'ReadLeaveSpecification', -- Name : STRING
    '', -- Descrip : STRING
    '
select many leaveSet from instances of LeaveSpecification ; //where selected.Name==param.Name;

 size = 0;
 
 for each leave in leaveSet
	size = size +1;
 end for;
 
  UI::Reply( msg:"Sending leave set .. ", state:True);

  for each leave in leaveSet
	UI::SendLeaveSpecification( Name:leave.Name, MaximumDays:leave.MaximumDays, MinimumDays:leave.MinimumDays, Size:size );
	size = size-1;
	UI::Reply( msg:"Sent: "+leave.Name, state:True);

  end for;
